import { useEffect, useState } from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import StationsList from './components/StationsList';
import Fecha from './components/Fecha'
import Gasolina98 from './components/Gasolina98';
import Gasoleo from './components/Gasoleo';

function App() {

  const initialUrl = 'https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/FiltroMunicipio/'

  return (
    <Router>
      <nav className='navbar navbar-expand-lg navbar-dark bg-dark'>
        <Link to="/" className='nav-link'>Inicio</Link>
        <Link to="/gasolina95" className='nav-link'>Gasolina 95</Link>
        <Link to="/gasolina98" className='nav-link'>Gasolina 98</Link>
        <Link to="/gasoleo" className='nav-link'>Gasóleo</Link>
      </nav>
      <Routes>
        <Route exact path="/" element={
        <div className='container mt-2'>
        <StationsList titulo='Gasolineras Arrecife' url={`${initialUrl}5237`}/>
        <StationsList titulo='Gasolineras San Bartolomé' url={`${initialUrl}5251`}/>
        <StationsList titulo='Gasolineras Haría' url={`${initialUrl}5243`}/>
        <StationsList titulo='Gasolineras Teguise' url={`${initialUrl}5256`}/>
        <StationsList titulo='Gasolineras Tías' url={`${initialUrl}5260`}/>
        <StationsList titulo='Gasolineras Tinajo' url={`${initialUrl}5261`}/>
        <StationsList titulo='Gasolineras Yaiza' url={`${initialUrl}5266`}/>
        <Fecha url='https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/FiltroMunicipio/5237'/>
        </div>
        }/>
        <Route exact path='/gasolina98' element={
        <div className='container mt-2'>
        <Gasolina98 titulo='Gasolineras Arrecife' url={`${initialUrl}5237`}/>
        <Gasolina98 titulo='Gasolineras San Bartolomé' url={`${initialUrl}5251`}/>
        <Gasolina98 titulo='Gasolineras Haría' url={`${initialUrl}5243`}/>
        <Gasolina98 titulo='Gasolineras Teguise' url={`${initialUrl}5256`}/>
        <Gasolina98 titulo='Gasolineras Tías' url={`${initialUrl}5260`}/>
        <Gasolina98 titulo='Gasolineras Tinajo' url={`${initialUrl}5261`}/>
        <Gasolina98 titulo='Gasolineras Yaiza' url={`${initialUrl}5266`}/>
        </div>
        }/>
        <Route exact path='/gasoleo' element={
        <div className='container mt-2'>
        <Gasoleo titulo='Gasolineras Arrecife' url={`${initialUrl}5237`}/>
        <Gasoleo titulo='Gasolineras San Bartolomé' url={`${initialUrl}5251`}/>
        <Gasoleo titulo='Gasolineras Haría' url={`${initialUrl}5243`}/>
        <Gasoleo titulo='Gasolineras Teguise' url={`${initialUrl}5256`}/>
        <Gasoleo titulo='Gasolineras Tías' url={`${initialUrl}5260`}/>
        <Gasoleo titulo='Gasolineras Tinajo' url={`${initialUrl}5261`}/>
        <Gasoleo titulo='Gasolineras Yaiza' url={`${initialUrl}5266`}/>
        </div>
        }/>
      </Routes>
    </Router>

  );
}

export default App;
